import Navigator from './route/vesnaStack'
import React from 'react';
import { VscMenu } from "react-icons/vsc";

function StackScreen() {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="Home"
        component={HomeScreen}
        options={{ title: 'My home' }}
      />
    </Stack.Navigator>
  );
}

export default function App() {
  return (
    <Navigator>
      <Stack.Screen
        name="Home"
        component={HomeScreen}
        options={{ title: 'My home' }}
      />
    </Navigator>
  )
}
